import React from 'react';
import './navBar.css';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <div className="nav-bar">

      <div className="nav-items">
        <span>
          <Link to="/">
            Hangry
          </Link>
        </span>
      </div>
    </div>
  );
};

export default NavBar;
